const nominator = (nominees = new Map(), imdbID, data, action) => {
    switch (action.type) {
        case 'NOMINATE':
            nominees.set(imdbID, data);
            return nominees;

        case 'REMOVE':
            nominees.delete(imdbID);
            return nominees;
    }
}

export default nominator;
